export default{
    Mutation:{
        upload: async(_,args,{request,isAuthenticated})=>{
            isAuthenticated(request);
            const{user} = request;
            const{caption, files} =args;
            const post = await prisma.createPost({caption,user:{connect:{id:user.id}}});
            files.forEach(
